  // Succulents Category
  {
    id: 1,
    name: "Echeveria Elegans",
    price: 12.99,
    image: "/images/plants/plant1.jpg",
    category: "Succulents",
    description: "A rosette-forming succulent with pale blue-green leaves"
  },
  {
    id: 2,
    name: "Haworthia Zebra",
    price: 9.99,
    image: "/images/plants/plant2.jpg",
    category: "Succulents",
    description: "Small succulent with dark green leaves and white stripes"
  },
  
  // Tropical Plants Category
  {
    id: 3,
    name: "Monstera Deliciosa",
    price: 24.99,
    image: "/images/plants/plant3.jpg",
    category: "Tropical Plants",
    description: "Popular tropical plant with unique split leaves"
  },
  {
    id: 4,
    name: "Fiddle Leaf Fig",
    price: 29.99,
    image: "/images/plants/plant4.jpg",
    category: "Tropical Plants",
    description: "Trendy houseplant with large, violin-shaped leaves"
  },
  
  // Air Plants Category
  {
    id: 5,
    name: "Tillandsia Ionantha",
    price: 7.99,
    image: "/images/plants/plant5.jpg",
    category: "Air Plants",
    description: "Small air plant that requires no soil to grow"
  },
  {
    id: 6,
    name: "Tillandsia Xerographica",
    price: 19.99,
    image: "/images/plants/plant6.jpg",
    category: "Air Plants",
    description: "Larger rosette-forming air plant with silvery gray leaves"
  }
